import React from "react";
import './Item.css'
import { Link } from "react-router-dom";

export const Item = (props) => {
  return (
    <div className="item">
       <Link to={`/product/${props.id}`}> <img onClick={window.scrollTo} src={props.image} alt="" />  </Link> 
      <p>{props.name}</p>
      <div className="item-prices">
        <div className="item-prices-new">
          ${props.new_prices}
        </div>
        <div className="item-prices-old">
          ${props.old_prices}
        </div>
      </div>
    </div>
  )
}
